import styled from "styled-components"
const MainWrapper = styled.section`
margin: 0 auto;
height: 360px;
width: 536px;
display: flex;
flex-direction: column;
justify-content: center;
`
const SearchType = styled.div`
width: 100%;
display: flex;
justify-content: space-between;
padding-left: 50px;
padding-right: 50px;
margin: 65px auto 20px auto;
`
const VinBlock = styled.div`
display: flex;
align-items: center;
justify-content: center;
width: 160px;
height: 33px;
border-bottom: 2px solid #3AD0E6;
`
const LicenseBlock = styled.div`
display: flex;
align-items: center;
justify-content: center;
width: 160px;
height: 33px;
border-bottom: 2px solid #3AD0E6;
`
const Input = styled.input`
margin: 0 auto;
width: 100%;
height: 60px;
border-radius: 40px;
padding-left:60px;
padding-right: 140px;
    ::placeholder{
    font-family: 'Roboto';
    font-weight: 200;
    font-size: 20px;
}
`

const Search = () => {
    return (
        <MainWrapper>
            <SearchType>
                <VinBlock>VIN</VinBlock>
                <LicenseBlock>LICENSE PLATE</LicenseBlock>
            </SearchType>
            <Input placeholder="Enter a VIN Number" />
        </MainWrapper>
    )
}

export default Search;
